template <int _MAX, int _I>
class LowerTriApply
{
public:
    static int rowApply() {
        int max = _MAX;
        int i = _I;
        int index = 0;
        int row[max];
        int dim = (int)(sqrtf(0.25+2*max)-0.5);
        for(int ii=0; ii<dim; ii++) {
            for(int jj=0; jj<ii+1; jj++) {
                row[index] = ii;
                index++;
            }
        }
        return row[i];
    }

    static int colApply() {
        int max = _MAX;
        int i = _I;
        int index = 0;
        int col[max];
        int dim = (int)(sqrtf(0.25+2*max)-0.5);
        for(int ii=0; ii<dim; ii++) {
            for(int jj=0; jj<ii+1; jj++) {
                col[index] = jj;
                index++;
            }
        }
        return col[i];
    }

    static int sizeApply() {
        int max = _MAX;
        int i = _I;
        int size[max];
        size[0] = 0;
        for(int ii=1; ii<max; ii++) {
            size[ii] = size[ii-1]+ii;
            if(i == ii) { return size[i]; }
        }
        return size[i];
    }
};

