    // mask_table[i] = mask(exp-BIAS+1);
    const typename fp_struct<T>::inttype t = 1LL << (fp_struct<T>::SIG_BITS-1);
    for(unsigned int i = 0; i < fp_struct<T>::BITS-2; i++) {
        mask_table[i] = t >> (i+1);
    }
    mask_table[fp_struct<T>::BITS-2] = t << 1; // Special case for round()
