template<int W, int M>
void
big_mult_v3(
    ap_uint<W> a,
    ap_uint<W> b,
    ap_uint<2*W> &m)
{
    const int N = (W+M-1)/M; // Take the ceiling of W/M
    // Partial products
    ap_uint<2*M> pp[N][N];
    int i, j;
    for (i = 0; i < N; ++i)
        for (j = 0; j < N; ++j) {
            unsigned Ui = (i == N-1) ? W-1 : M*(i+1)-1;
            unsigned Uj = (j == N-1) ? W-1 : M*(j+1)-1;
            pp[i][j] = a(Ui,M*i) * b(Uj,M*j);
        }

    // Partial product sums
    ap_uint<48> pps[2*N];
    pps[0] = pp[0][0];
    // Add partial products diagonally
    for (i = 1; i < 2*N; ++i) {
        pps[i] = pps[i-1] >> M;
        for (j = 0; j < N; ++j)
            if ((j <= i) && (i-j < N)) {
                pps[i] += pp[j][i-j];
            }
    }

    // Extract out the useful bits
    for (i = 0; i < 2*N; ++i) {
        unsigned Li = M*i;
        if (Li < 2*W) {
            unsigned Ui = M*(i+1)-1;
            if (Ui >= 2*W) { Ui = 2*W-1; }
            m(Ui,Li) = pps[i](M-1, 0);
        }
    }
}

// M is the size of multiplier to decompose into.
template<int W, int W2, int M>
void
big_mult_v3small(
    ap_uint<W> a,
    ap_uint<W2> b,
    ap_uint<W+W2> &m)
{
    const int N = (W+M-1)/M; // Take the ceiling of W/M
    // Partial products
    ap_uint<M+W2> pp[N];
    int i;
    for (i = 0; i < N; ++i) {
        unsigned Ui = (i == N-1) ? W-1 : M*(i+1)-1;
        pp[i] = a(Ui,M*i) * b;
    }

    // Partial product sums
    ap_uint<M+W2> pps[N];
    pps[0] = pp[0];
    // Add partial products
    for (i = 1; i < N; ++i) {
        pps[i] = pps[i-1] >> M;
        pps[i] += pp[i];
    }

    // Extract out the useful bits
    for (i = 0; i < N-1; ++i) {
        unsigned Li = M*i;
        if (Li < W+W2) {
            unsigned Ui = M*(i+1)-1;
            if (Ui >= W+W2) { Ui = W+W2-1; }
            m(Ui,Li) = pps[i](M-1, 0);
        }
    }
    unsigned Li = M*i;
    if (Li < W+W2) {
        // The highest term is larger than the others
        unsigned Ui = W+W2-1;
        m(Ui,Li) = pps[i];//(M-1, 0);
    }
}

template<int SELECT, int W, int M>
void
big_mult(
    ap_uint<W> a,
    ap_uint<W> b,
    ap_uint<2*W> &m)
{
    switch(SELECT) {
        case 1:
            big_mult_v1(a,b,m);
            break;
        case 2:
            big_mult_v2<W,M>(a,b,m);
            break;
        default:
            big_mult_v3<W,M>(a,b,m);
            break;
    };
}

template<int W, int M>
void
big_mult(
    ap_uint<W> a,
    ap_uint<W> b,
    ap_uint<2*W> &m)
{
    big_mult<3,W,M>(a,b,m);
}


template<int W1, int W2>
void
big_mult(
    ap_uint<W1> a,
    ap_uint<W2> b,
    ap_uint<W1+W2> &m)
{
    if(W2 <= 64) {
        // Decompose into 17x64 multipliers
        big_mult_v3small<W1,W2,17>(a,b,m);
    } else {
        //const int W_MAX =(W1 > W2) ? W1 : W2;
//         const int tmp =(W1 > W2) ? W1 : W2;
//         const int mod = (tmp+ 16)/17;
//         const int W_MAX = 17*mod;

        ap_uint<(17*(((W1 > W2) ? W1 : W2)+ 16)/17)> a_m = a;
        ap_uint<(17*(((W1 > W2) ? W1 : W2)+ 16)/17)> b_m = b;
        ap_uint<2*(17*(((W1 > W2) ? W1 : W2)+ 16)/17)> m_m;
        big_mult<(17*(((W1 > W2) ? W1 : W2)+ 16)/17),17>(a_m,b_m,m_m);

        m = m_m;
    }
}

template <int W1, int I1, int W2, int I2>
void
big_mult(
    ap_ufixed<W1,I1> a,
    ap_ufixed<W2,I2> b,
    ap_ufixed<W1+W2,I1+I2> &m)
{
    ap_uint<W1> ai;
    ap_uint<W2> bi;
    ap_uint<W1+W2> mi;
    ai(W1-1, 0) = a(W1-1, 0);
    bi(W2-1, 0) = b(W2-1, 0);
    big_mult(ai,bi,mi);
    m(W1+W2-1,0) = mi(W1+W2-1,0);
}




