static float tanf(float t_in)
{
 float s_out, c_out;
    fp_struct<float> fs = t_in;
    if(fs.exp <= 0x1) {
        //subnormal or zero or small number
        return t_in;
    } else {
        ::hls::sincosf(t_in, &s_out, &c_out);
        return ((s_out)/(c_out));
    }
}

