static double hypot(double x, double y) {
    if ( ::hls::__isinf(x) )
 return fabs(x);
    if ( ::hls::__isinf(y) )
 return fabs(y);
    return ::sqrt(x*x+y*y);
}
static float hypotf(float x, float y) {
    if ( ::hls::__isinf(x) )
        return fabs(x);
    if ( ::hls::__isinf(y) )
        return fabs(y);
    double xd = x;
    double yd = y;
    return ::sqrt(xd*xd+yd*yd);
}
static half half_hypot(half x, half y) {
    if ( ::hls::__isinf(x) )
        return fabs(x);
    if ( ::hls::__isinf(y) )
        return fabs(y);
    float xf = x;
    float yf = y;
    return ::sqrtf(xf*xf+yf*yf);
}

