    ((anchor.x >= 0) ? static_cast<void> (0) : __assert_fail ("anchor.x >= 0", "/scratch/xilinx/SDx/2017.1/Vivado_HLS/common/technology/autopilot/hls/hls_video_imgproc.h", 423, __PRETTY_FUNCTION__));
