    ((cols <= IMG_WIDTH) ? static_cast<void> (0) : __assert_fail ("cols <= IMG_WIDTH", "/scratch/xilinx/SDx/2017.1/Vivado_HLS/common/technology/autopilot/hls/hls_video_imgproc.h", 1039, __PRETTY_FUNCTION__));

